import React from 'react';
import LandingPage from './components/userApp/Dashboard';
import RegisterPage from './components/userApp/Dashboard';
import LoginPage from './components/userApp/Dashboard';
import Dashboard from './components/userApp/Dashboard';
import Game from './components/userApp/Dashboard';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useLocation } from 'react-router-dom';
import './assets/css/style.css';

function App() {
    const location = useLocation();
    return (
        <Router>
            <Routes>
                <Route path="/" element={<LandingPage />} />
                <Route path="/register" element={<RegisterPage />} />
                <Route path="/login" element={<LoginPage />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/game" element={<Game />} />
            </Routes>
        </Router>
    );
}

export default App;
